export default { 
	username: null, 
	password: null, 
	isAuthenticated: (username, password) => { 
		if(username == null || password == null) { 
			return false; 
		} else { 
			if(username == "John" && password == "123") { 
				return true; 
			} else { 
				return false; 
			}
		} 
	} 
}
